import React from "react";
import "./notis.scss";
import { GoBell } from "react-icons/go";

const getIcon=(type)=>{
    if(type=="goBell"){
    return(
        <GoBell/>
    )}
}
const Notis = ({ message, icon }) => {
  return (
    <div className="notisbox">
      <div classname="notisicon">{icon}</div>

      <div className="notismsg">{message}</div>
    </div>
  );
};

export default Notis;
